import React, {FC} from "react";
import {TextField, TextFieldProps} from "@material-ui/core";
import {Field, FieldProps} from "formik";


export const CustomFormikField: FC<FieldProps & TextFieldProps> = (props) => {
    return (
        <Field {...props}>
            {
                ({field}) => (
                    <TextField
                        fullWidth
                        focused={false}
                        variant='outlined'
                        {...field}
                        {...props}
                    />
                )
            }
        </Field>
    )
};
